import { Swiper, SwiperSlide } from 'swiper/react';

import 'swiper/css';

// import './styles.css';

import { Autoplay } from 'swiper/modules';

const Ads = () => {
  return (
    <>
      <Swiper
        spaceBetween={30}
        centeredSlides={true}
        autoplay={{
          delay: 2500,
          disableOnInteraction: false,
        }}
        pagination={{
          clickable: true,
        }}
        navigation={true}
        modules={[Autoplay]}
        className='rounded-lg w-full object-cover'
      >
        <SwiperSlide>
          <img src='https://lovelymeregis.co.uk/thumbs/Images/gallery/DSC_2471.jpg' alt='ads' className='rounded-lg w-1/2 object-cover'/>
        </SwiperSlide>
        <SwiperSlide>
            <img src='https://lovelymeregis.co.uk/thumbs/Images/gallery/DSC_2474.jpg' alt='ads' className='w-full rounded-lg object-cover'/>
        </SwiperSlide>
        <SwiperSlide>
          <img src='https://lovelymeregis.co.uk/thumbs/Images/gallery/DSC_2478.jpg' alt='ads' className='w-full rounded-lg object-cover'/>
        </SwiperSlide>
        <SwiperSlide>
          <img src='https://lovelymeregis.co.uk/thumbs/Images/gallery/sunset-boat-harbour-june21.jpg' alt='ads' className='w-full rounded-lg object-cover'/>
        </SwiperSlide>
      </Swiper>
    </>
  )
}

export default Ads
